       }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"4d50b751-c242-4945-bc54-b95134544a7e","type":"CustomJS"},{"attributes":{},"id":"f845e14a-1182-405a-be90-59b4a664bfda","type":"LinearScale"},{"attributes":{},"id":"a828fe11-5db2-4ee9-957a-6248d792a53b","type":"WheelZoomTool"},{"attributes":{"plot":null,"text":"Plot of the homology YBL003C"},"id":"9032d81e-532b-4891-bfc4-d925f46ab0aa","type":"Title"},{"attributes":{"callback":null,"tooltips":[["species","@species"],["nan_nb","@nans"],["mean_entr","@meanentropy"],["length","@lengths"],["GCcount","@gc"]]},"id":"b44d0e76-8010-46f8-88f7-449669e9952f","type":"HoverTool"},{"attributes":{"source":{"id":"077d2cc7-22e8-4860-af62-5c9e286b7d00","type":"ColumnDataSource"}},"id":"76b58557-16a2-4a13-9b20-77f3d933ee4d","type":"CDSView"},{"attributes":{"callback":null},"id":"fde1b038-339e-40ee-998e-9768dc7df56b","type":"DataRange1d"},{"attributes":{"formatter":{"id":"394d435f-0c84-45cb-b02b-8fc2ec99a0d9","type":"BasicTickFormatter"},"plot":{"id":"d07a5208-ca5e-4354-97c3-748dab8dc137","subtype":"Figure","type":"Plot"},"ticker":{"id":"b03a5c87-
